import React,{Component} from 'react'
import style from 'styled-components'
class Item extends Component{
    render(){
        const CardWrapper = style.div`
        overflow: hidden;
        padding: 0 0 32px;
        margin: 48px auto 0;
        width: 65%;
        height: 120px;
        box-shadow: 0 0 10px rgba(0, 0, 0, .05), 0 0px 30px rgba(0, 0, 0, .08);
        border-radius: 13px;
        `

    return(
        <div>
            <CardWrapper />
        </div>
    );
    } 

}

export default Item;
